TABLEATTRIBUTE.VALUE:
UPDATE $$ETLVWDB.DW_JOB_STREAMS_NRT 
SET LAST_EXTRACT_DATE=(SELECT MAX(EDW_UPDATE_DTM) FROM $$NRTNCRVWDB.MT_DRVD_NCR_BKG_TRX)
WHERE JOB_STREAM_ID='wf_WI_DRVD_NRT_BKG_TRX';

COLLECT STATS ON $$NRTSTGDB.WI_DRVD_NRT_BKG_TRX;

COLLECT STATS ON $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR;
/* Added Post SQL to update the Bundle Quantity for Attributed Records - Q1FY15 - OA */
UPDATE INCR FROM $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR INCR, ( SELECT DRVD_NCR_BKG_TRX_KEY AS BOOKINGS_MEASURE_KEY, DV_SALES_ORDER_LINE_KEY, TRANSACTION_QUANTITY, FORWARD_REVERSE_CODE, PROCESS_DATE, SALES_REP_NUMBER, ES_LINE_SEQ_ID_INT FROM $$NRTNCRVWDB.MT_DRVD_NCR_BKG_TRX TRX WHERE 1=1 AND (TRX.DV_ATTRIBUTION_CD = 'BUNDLE' ) AND (DV_SALES_ORDER_LINE_KEY , PROCESS_DATE) IN (SELECT DV_SALES_ORDER_LINE_KEY , PROCESS_DATE FROM $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR GROUP BY 1,2) )DRVD SET BUNDLE_TRANSACTION_QUANTITY = (CASE WHEN INCR.DV_ATTRIBUTION_CD ='OFFSET' THEN (DRVD.TRANSACTION_QUANTITY * -1) ELSE DRVD.TRANSACTION_QUANTITY END) WHERE INCR.DV_SALES_ORDER_LINE_KEY = DRVD.DV_SALES_ORDER_LINE_KEY AND INCR.FORWARD_REVERSE_CODE = DRVD.FORWARD_REVERSE_CODE AND INCR.PROCESS_DATE = DRVD.PROCESS_DATE AND INCR.SALES_REP_NUMBER = DRVD.SALES_REP_NUMBER AND INCR.ES_LINE_SEQ_ID_INT = DRVD.ES_LINE_SEQ_ID_INT AND INCR.DV_ATTRIBUTION_CD IN('ATTRIBUTED','OFFSET') ;

ATTRIBUTE.VALUE:
UPDATE $$ETLVWDB.DW_JOB_STREAMS_NRT 
SET LAST_EXTRACT_DATE=(SELECT MAX(EDW_UPDATE_DTM) FROM $$NRTNCRVWDB.MT_DRVD_NCR_BKG_TRX)
WHERE JOB_STREAM_ID='wf_WI_DRVD_NRT_BKG_TRX';

/* COLLECT STATS ON $$NRTSTGDB.WI_DRVD_NRT_BKG_TRX; */

CALL COLLECT_STATS_WRAP('$$NRTSTGDB','WI_DRVD_NRT_BKG_TRX','D');

/*COLLECT STATS ON $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR;*/
CALL COLLECT_STATS_WRAP('$$NRTSTGDB','MT_DRVD_NCR_BKG_TRX_INCR','D');
/* Added Post SQL to update the Bundle Quantity for Attributed Records - Q1FY15 - OA */
UPDATE INCR FROM $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR INCR, ( SELECT DRVD_NCR_BKG_TRX_KEY AS BOOKINGS_MEASURE_KEY, DV_SALES_ORDER_LINE_KEY, TRANSACTION_QUANTITY, FORWARD_REVERSE_CODE, PROCESS_DATE, SALES_REP_NUMBER, ES_LINE_SEQ_ID_INT FROM $$NRTNCRVWDB.MT_DRVD_NCR_BKG_TRX TRX WHERE 1=1 AND (TRX.DV_ATTRIBUTION_CD = 'BUNDLE' ) AND (DV_SALES_ORDER_LINE_KEY , PROCESS_DATE) IN (SELECT DV_SALES_ORDER_LINE_KEY , PROCESS_DATE FROM $$NRTSTGDB.MT_DRVD_NCR_BKG_TRX_INCR GROUP BY 1,2) )DRVD SET BUNDLE_TRANSACTION_QUANTITY = (CASE WHEN INCR.DV_ATTRIBUTION_CD in ('OFFSET','BIB OFFSET') THEN (DRVD.TRANSACTION_QUANTITY * -1) ELSE DRVD.TRANSACTION_QUANTITY END) WHERE INCR.DV_SALES_ORDER_LINE_KEY = DRVD.DV_SALES_ORDER_LINE_KEY AND INCR.FORWARD_REVERSE_CODE = DRVD.FORWARD_REVERSE_CODE AND INCR.PROCESS_DATE = DRVD.PROCESS_DATE AND INCR.SALES_REP_NUMBER = DRVD.SALES_REP_NUMBER AND INCR.ES_LINE_SEQ_ID_INT = DRVD.ES_LINE_SEQ_ID_INT AND INCR.DV_ATTRIBUTION_CD IN('ATTRIBUTED','OFFSET','BIB','BIB OFFSET');
